import { useState } from "react";
import { Link } from "react-router-dom";
import Button from "react-bootstrap/Button";

import "../../../styles/style.css";

export const Head = () => {
  //Define um estado para armazenar os valores dos campos do formulário
  const [formValues, setFormValues] = useState({
    dor_de_cabeca: false,
    nausea: false,
    sensibilidade_a_luz: false,
    tontura: false,
    visao_turva: false,
  });

  // Função que atualiza o estado quando um campo é modificado
  const handleInputChange = (event) => {
    const headArray = {};
    if (formValues[0] == false) {
      headArray.push(0);
    } else {
      headArray.push(1);
    }
    if (formValues[1] == false) {
      headArray.push(0);
    } else {
      headArray.push(1);
    }
    if (formValues[2] == false) {
      headArray.push(0);
    } else {
      headArray.push(1);
    }
    if (formValues[3] == false) {
      headArray.push(0);
    } else {
      headArray.push(1);
    }
    if (formValues[4] == false) {
      headArray.push(0);
    } else {
      headArray.push(1);
    }
  };

  return (
    <div class="main-div">
      <div class="box-div">
        <h1>Sintomas na Cabeça</h1>
        <form>
          <label>
            <input
              type="checkbox"
              name="dor_de_cabeca"
              checked={formValues.dor_de_cabeca}
              onChange={handleInputChange}
            />
            <span>&nbsp;</span>Dor de cabeça
          </label>
          <label>
            <input
              type="checkbox"
              name="nausea"
              checked={formValues.nausea}
              onChange={handleInputChange}
            />
            <span>&nbsp;</span>Náusea
          </label>
          <label>
            <input
              type="checkbox"
              name="sensibilidade_a_luz"
              checked={formValues.sensibilidade_a_luz}
              onChange={handleInputChange}
            />
            <span>&nbsp;</span>Sensibilidade a Luz
          </label>
          <label>
            <input
              type="checkbox"
              name="tontura"
              checked={formValues.tontura}
              onChange={handleInputChange}
            />
            <span>&nbsp;</span>Tontura
          </label>
          <label>
            <input
              type="checkbox"
              name="visao_turva"
              checked={formValues.visao_turva}
              onChange={handleInputChange}
            />
            <span>&nbsp;</span>Visão turva
          </label>
          <Button onClick={handleInputChange}>Teste</Button>
          <Button></Button>
          <Link to="/chest">
            <Button type="submit" className="btn-custom">
              Próximo
            </Button>
          </Link>
        </form>
      </div>
    </div>
  );
};
